import React from 'react';
import MyAnswerCard from 'app/main/reusables/MyAnswerCard'
import axiosInstance from 'app/main/axios';
import {useState, useEffect} from 'react';

export default function PostsTab()
{
    const [myAnswers, setMyAnswers] = useState(null);

    {useEffect(() => {
        axiosInstance.get('my-answer-list/').then(res => {
            setMyAnswers(res.data);
        });
    }, []);}

    if(!myAnswers)
    {
        return null;
    }

    return(
        myAnswers.map(item => (<MyAnswerCard item = {item} />))
    )

}
